import "./input.css";

function Input() {
  return (
    <div className="input-wrapper">
      <form>
        <div>
          <label>Number : </label>
        </div>
        <div>
          <input type="number" min="10" max="99" />
        </div>
        <div>
        <button type="submit">Update</button>
        </div>
      </form>
    </div>
  );
}

export default Input;
